    public int[,] GenerateMatrix(int seed)
    {
        if (seed == 0)
        {
            // Devuelve una matriz aleatoria
            int randomIndex = Random.Range(0, matrices.Count);
            return matrices[randomIndex];
        }
        else
        {
            // Devuelve una matriz específica (si el seed es válido)
            int index = seed - 1;
            if (index >= 0 && index < matrices.Count)
            {
                return matrices[index];
            }
            else
            {
                Debug.LogError("Seed value out of range.");
                int randomIndex = Random.Range(0, matrices.Count);
                return matrices[randomIndex];
            }
        }
    }
